import React from "react";
import Dp from "./img/dp.jpeg";

const Profile = () => {
  return (
    <div className="grid grid-cols-1 md:grid-cols-4">
      <div className="bg-gray-700 shadow m-3 rounded-xl h-screen p-2">
        <div className="p-4 ">
          <img
            className="w-48 h-48 align-middle  rounded-full border-solid border-4 mx-auto"
            src={Dp}
            alt=""
          />
        </div>
        <div className="text-center text-white">
          <h1 className="text-2xl">Khalid Ibn Alam Utsob</h1>

          <h1 className="text-base">
            Ghatail Cantonment Public School & College
          </h1>
        </div>
      </div>
      <div className=" shadow col-span-3 m-3 rounded-xl bg-gray-300 h-screen p-2">
        Info
      </div>
    </div>
  );
};

export default Profile;
